import React, {Component} from 'react';
import ArticleList from './Article-list'



class App extends Component {
  constructor(props){
    super(props)
    this.state = {}

  }

  render (){
   if (this.state.data != null){
     return (
       <div>
         <ArticleList />
       </div>
     )
   } 
  }
}

export default App;
